        [Test]
        public void AllEncounterConstantsAreUnique()
        {
            var encounters = EncounterConstants.GetAll();
            Assert.That(encounters, Is.Unique);
        }

        [Test]
        public void AllEncounterConstants()
        {
            var encounters = EncounterConstants.GetAll();
            var encounterConstants = typeof(EncounterConstants);
            var fields = encounterConstants.GetFields(BindingFlags.Public | BindingFlags.Static);
            var constantFields = fields.Where(f => f.IsLiteral && !f.IsInitOnly);
            var constants = constantFields.Select(f => f.GetValue(null) as string);

            Assert.That(encounters, Is.EquivalentTo(constants));
        }
    }
